import React, {Component} from 'react';
import PropTypes from 'prop-types';
import {connect} from 'react-redux';
import {fetchPosts} from "../../redux/actions/postActions";
import dicomenu from "../../images/dicomenu1.png";
import {Grid, Row, Col, Image, Button} from 'react-bootstrap';
// eslint-disable-next-line
import {Link} from 'react-router-dom';

class Portfolio extends Component {
    componentWillMount() {
        this.props.fetchPosts();
    }

    render() {
        const postItems = this.props.posts.map(post => (
                <Col md={4} xs={12} key={post.id} >
                    <div>
                        <Image src={post.url} className="contentImg"></Image>
                    </div>
                    <div className="contentTitle">
                        <h3>{post.title}</h3>
                        {/*<Link to={`${match.url}/${post.id}`}>*/}
                        {/*Bekijk het project*/}
                        {/*</Link>*/}
                    </div>
                </Col>
        ));
        return (
                <div className="PortfolioPage">

                    <Grid>
                        <Row className="show-grid">
                            {/*{postItems}*/}

                            <Col md={12} >
                                <h1 className="portHead-title">Bekijk hier al onze projecten</h1>
                            </Col>
                        </Row>

                        <Row>
                            <Col md={12} >
                              <section>
                                  <div className="contentTile">
                                      <div className="contentTile__section">
                                          <div className="image-cell">
                                              <a href="">
                                                  <Image src={dicomenu} className="contentImg"/>
                                              </a>
                                          </div>
                                          <div className="content-cell">
                                              <div className="content-cell-container">
                                                  <div>
                                                      <h2 className="title"><a href="" rel="bookmark">Dicomenu</a></h2>
                                                      <h3 className="client"><a href="">Webshop</a></h3>
                                                  </div>
                                                  <p className="view-project">
                                                      <a href="">Bekijk Project</a>
                                                  </p>
                                              </div>
                                          </div>
                                      </div>

                                  </div>


                              </section>
                            </Col>
                        </Row>
                    </Grid>
                </div>
        );
    }
}

Portfolio.propTypes = {
    fetchPosts: PropTypes.func.isRequired,
    posts     : PropTypes.array.isRequired
};
const mapStateToProps = state => ({
    posts: state.posts.items
});

export default connect(mapStateToProps, {fetchPosts})(Portfolio);
